// export default ProfilePage;
import React, { useState } from 'react';
import '../styles/pages/ProfileStyle.css'; // Keep your original CSS import
import Navbar from '../components/Navbar';

function ProfilePage() {
    const [isEditing, setIsEditing] = useState(false);
    const [userData, setUserData] = useState({
        email: 'b.alramlawi360@gmail.com',
        username: 'ggg',
        userType: 'Regular',
        hourlyRate: '$900',
        isVerified: 'Yes',
    });

    const handleEditClick = () => {
        setIsEditing(true);
    };

    const handleSaveClick = () => {
        setIsEditing(false);
        // Add logic to save updated data here
    };

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setUserData({
            ...userData,
            [name]: value,
        });
    };

    return (
        <div className="profile-container">
            <Navbar />
            <div className="profile-card">
                <div className="profile-header">
                    <img
                        src={process.env.PUBLIC_URL + '/profile.png'}
                        alt="ProfilePage"
                        className="profile-image"
                    />
                    <h2 className="profile-title">ProfilePage Information</h2>
                </div>
                <div className="profile-info">
                    {Object.keys(userData).map((key) => (
                        <div className="profile-item" key={key}>
                            <label className="profile-label">{key}:</label>
                            {isEditing ? (
                                <input
                                    type="text"
                                    name={key}
                                    value={userData[key]}
                                    onChange={handleInputChange}
                                    className="profile-input"
                                />
                            ) : (
                                <p className="profile-value">{userData[key]}</p>
                            )}
                        </div>
                    ))}
                    {isEditing ? (
                        <button className="profile-save-button" onClick={handleSaveClick}>
                            Save
                        </button>
                    ) : (
                        <button className="profile-edit-button" onClick={handleEditClick}>
                            Edit
                        </button>
                    )}
                </div>
            </div>
        </div>
    );
}

export default ProfilePage;
